import React from "react";
import { useQuery } from "@apollo/react-hooks";
import gql from "graphql-tag";

const Home = () => {
  const {
    loading,
    data: { getNotes },
  } = useQuery(FETCH_POST_QUERY);
  if (getNotes) {
    console.log(getNotes);
  }
  return (
    <div>
      <h1>HomePage</h1>
    </div>
  );
};

const FETCH_POST_QUERY = gql`
  {
    getNotes {
      id
      body
      createdAt
      username
    }
  }
`;

export default Home;
